import classes from "./Button.module.css";

const Button = (props) => {
  const childrenName = (event) => {
    console.log(event.target.value);
  };
  return (
    <button onClick={childrenName} className={classes.button}>
      {props.children}
    </button>
  );
};
export default Button;
